script: |
  super -f text -I q7177.spq | sort > q7177.out

inputs:
  - name: q7177.spq
    data: |
      SELECT - + col1 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT NULL IS NOT NULL OR - - col2 NOT BETWEEN - col2 + + col0 + + 68 - - - col2 AND + 29;
  - name: tab1

outputs:
  - name: q7177.out
    data: |
      -14
      -47
      -5
